using System;
using System.Collections.Generic;
using System.Globalization;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Controls;
using System.Windows.Data;
using System.Windows.Media.Imaging;

namespace ClientWPF.Converters
{
    class StringToBmp : IValueConverter
    {
        public object Convert(object value, Type targetType, object parameter, CultureInfo culture)
        {
            byte[] binaryData;
            String photoNonAvailiable = "";
            if (!String.IsNullOrEmpty((string)value))
            {
                 binaryData =  System.Convert.FromBase64String((string)value);
            }
            else
            {
                binaryData = System.Convert.FromBase64String(photoNonAvailiable);
            }

            BitmapImage bi = new BitmapImage();
            bi.BeginInit();
            bi.CacheOption = BitmapCacheOption.OnLoad;
            bi.StreamSource = new MemoryStream(binaryData);
            bi.EndInit();
            bi.Freeze();

            return bi;
        }

        public object ConvertBack(object value, Type targetType, object parameter, CultureInfo culture)
        {
            throw new NotImplementedException();
        }
    }
}
